  display: inline-block;
  width: 200px;
  height: 80px;
  border: 1px solid black;
  text-align: center;
  justify-content: center;
  vertical-align: middle & + & {
    margin: 10px;
  }

  &:first-child {
    margin: 10px;
  }
`;

const TagName = styled.span`
  display: flex;
`;

const Sharp = styled.span`
  display: flex;
`;

function MainTrendItem({
  date,
  hashtag,
  postCnt,
  checkStartTime,
  postGap,
  postRate,
}) {
  console.log("date", date);
  return (
    <ItemBox>
      <Sharp>#</Sharp>
      <TagName>{hashtag}</TagName>
    </ItemBox>
  );
}

export default MainTrendItem;
